import testImage from "../svg/test.svg";

const SevenDayForecast = () => {
    return (  
        <div>
            <h1>7-Day Forecast</h1>

            <div>
                <h3>Today</h3>
                <img src={testImage} alt="" />
                <h3>Sunny</h3>
            </div>
        </div>
    );
}
 
export default SevenDayForecast;
